import React from "react";
import "../components";

const categories = [
  "Electronics",
  "Fashion",
  "Home & Kitchen",
  "Beauty",
  "Sports",
  "Toys",
];

const Sidebar = () => {
  return (
    <div className="sidebar">
      <ul>
        {categories.map((cat, index) => (
          <li key={index}>
            {cat}
            <div className="submenu">Subcategory 1 | Subcategory 2</div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Sidebar;
